import React, { Component } from 'react'
import Container from './../container'
import Nav1 from './nav1'
import Nav2 from './nav2'
import Nav3 from './nav3'
// import LPnav from './LPnav'
// import Adwords from './Adwords'

class Nav extends Component {

    render() {
        return (
            <>
                <div className="">
                    <div className="navbar simpler z-depth-0   darkers  border-bottom py-0 my-0 px-md-5 px-sm-3 mobile-hide pb-0">
                        <Nav1 />
                    </div>
                </div>
                <div className="navbar  navbar-category blue lighten-1 lg-hidden sm-hidden  pt-2 mt-0 py-md-2 my-0 border-0">
                    <Nav3 />
                </div>
                <div id="topnav" className="py-1 white simpler navbar navbar1  border-bottom z-depth-0  mb-0 px-md-5">
                    <Nav2 sidenav={this.props.side} />
                </div>
                {/* <div className=""> */}
                <Container />
                {/* <Container class={"border"} /> */}

            </>
        )
    }
}
export default Nav
